 // Magic number.\n    }\n  }\n\n  &.uds-hero-sm {\n    height: $uds-size-spacing-32;\n\n    .container.uds-hero-container {\n      width: 100%;\n    }\n  }\n\n  &.uds-hero-md {\n    height: $uds-size-spacing-64;\n\n    .container {\n      @include container-md-and-lg();\n    }\n  }\n\n  &.uds-hero-lg {\n    height: 42.75rem; // 684px\n\n    .container.uds-hero-container {\n      @include container-md-and-lg();\n    }\n  }\n}\n\n/*--------------------------------------------------------------\n3. Hero, Mobile\n--------------------------------------------------------------*/\n\n.uds-hero {\n  .uds-hero-container {\n\n    // Mobile adjustments.\n    @media screen and (max-width: 576px) {\n      margin-bottom: -2rem;\n\n      h1 {\n        max-width: 100%;\n      }\n\n      p {\n        display: none;\n      }\n    }\n  }\n\n  &.uds-hero-sm {\n\n    // Adjustment to sm hero spacing for mobile.\n    @media screen and (max-width: 576px) {\n      padding-left: $uds-size-spacing-3;\n      padding-bottom: $uds-size-spacing-4;\n    }\n  }\n\n  &.uds-hero-md {\n    @media screen and (max-width: 576px){\n      height: $uds-size-spacing-32;\n    }\n  }\n\n  &.uds-hero-lg {\n\n    // Snap lg hero to md at 1400px.\n    @media screen and (max-width: 1400px) {\n      height: $uds-size-spacing-64;\n    }\n  }\n}\n\n/*--------------------------------------------------------------\n4. Story Hero, Mobile\n--------------------------------------------------------------*/\n.uds-story-hero {\n\n  // Calc value in the grid-template row definitions:\n  // First row = height of the overall mobile hero image - 4.5rem offset for the indented content.\n  display: grid;\n  grid-template-columns: $uds-size-spacing-2 1fr $uds-size-spacing-2;\n  grid-template-rows: calc(#{$uds-size-spacing-32} - 4.5rem) 4.5rem auto;\n  gap: 0px 0px;\n  max-width: 1920px;\n  margin: 0 auto;\n\n  .hero {\n    grid-column: 1 / span 3;\n    grid-row: 1 / span 2;\n    object-fit: cover;\n    height: 100%;\n    max-width: 100%;\n  }\n\n  .content {\n    grid-column: 2 / span 1;\n    grid-row: 2 / span 2;\n    background-color: $uds-color-base-white;\n\n    // Padding from top of content box should be carried by whatever element comes within it.\n    padding: 0 $uds-size-spacing-2;\n\n    .breadcrumb,\n    p.meta {\n      padding: .75rem 0;\n      margin: $uds-size-spacing-half 0;\n    }\n\n    h1 {\n      margin-top: 0;\n    }\n  }\n}\n\n/*--------------------------------------------------------------\n5. Story Hero, Desktop\n--------------------------------------------------------------*/\n\n// Firing "tablet" breakpoint prior to the standard $lg breakpoint due to expected image proportion size.\n@media (min-width: 950px) {\n\n  // Calc value in the grid-template row definitions:\n  // First row = height of the overall hero image - 8rem offset for the indented content.\n  .uds-story-hero {\n    grid-template-columns: $uds-size-spacing-3 1fr $uds-size-spacing-3;\n    grid-template-rows: calc(#{$uds-size-spacing-64} - #{$uds-size-spacing-16}) $uds-size-spacing-16 1fr;\n\n    &.uds-story-hero-lg {\n      grid-template-rows: calc(42.75rem - #{$uds-size-spacing-16}) $uds-size-spacing-16 1fr;\n    }\n\n    // Calc value: 8.34% is the width of one bootstrap column. 12px is the gutter on the outside.\n    .content {\n      padding: 0 calc(8.34% + 12px);\n\n      .breadcrumb,\n      p.meta {\n        margin: 1.25rem 0 2.25rem;\n      }\n    }\n  }\n}\n\n@include media-breakpoint-up(xl) {\n  .uds-story-hero {\n    grid-template-columns: 1fr calc(1200px + 12px + 12px) 1fr;\n  }\n}\n',".breadcrumb.bg-gray-7 {\n  li.active {\n    color: $uds-color-base-gray-1;\n  }\n}\n","/*------------------------------------------------------------------\nSidebar Navigation\n\n1. Component Mixins\n2. Sidebar\n-------------------------------------------------------------------*/\n\n@mixin like-an-h4 {\n  font-size: 1rem;\n  line-height: 1.5rem;\n  letter-spacing: -0.037rem;\n}\n\n@mixin like-an-h5 {\n  font-size: 1rem;\n  line-height: 1rem;\n  letter-spacing: -0.015em;\n}\n\n/*------------------------------------------------------------------\n2. Sidebar\n--------------------------------------------------------------------*/\n\n.sidebar {\n  .nav-text {\n    @include like-an-h5;\n    color: $uds-color-base-gray-7;\n    padding: $uds-size-spacing-2;\n    border: 1px solid $uds-color-base-gray-2;\n\n    &:not(:last-child) {\n      border-bottom: 0;\n    }\n  }\n\n  .nav-link {\n    color: $uds-color-base-gray-7;\n\n    &:hover {\n      text-decoration: underline;\n    }\n\n    &:visited {\n      color: $uds-color-base-gray-7;\n    }\n\n    &.active {\n      text-decoration: none;\n      padding-bottom: 0;\n    }\n\n    &.active:after {\n      content: '';\n      position: relative;\n      display: block;\n      margin-top: $uds-size-spacing-2;\n      height: $uds-size-spacing-1;\n      width: 100%;\n      background-color: $uds-color-base-gold;\n      text-decoration: none;\n    }\n  }\n\n  > .nav-link {\n    border: 1px solid $uds-color-base-gray-2;\n    padding: $uds-size-spacing-3 $uds-size-spacing-2;\n    overflow: hidden;\n    color: $uds-color-base-gray-7;\n\n    @include like-an-h4;\n\n    &:not(:last-child) {\n      border-bottom: 0;\n    }\n  }\n\n  .card-foldable {\n    border: 1px solid $uds-color-base-gray-2;\n\n    .card-header,\n    .card-body {\n      background-color: transparent;\n    }\n\n    .card-header {\n      h1, h2, h3, h4, h5\n      {\n        font-weight: 400;\n      }\n\n      a {\n        padding: $uds-size-spacing-2 $uds-size-spacing-1;\n      }\n\n      ~ .card-body {\n        border-top: 0;\n      }\n    }\n\n    .card-body {\n      padding: 0 $uds-size-spacing-2 $uds-size-spacing-2 $uds-size-spacing-2;\n    }\n\n    .card-body > .nav-link {\n      padding: 0 $uds-size-spacing-5 0 $uds-size-spacing-3;\n\n      &:after {\n        margin-top: $uds-size-spacing-1;\n      }\n\n      + .nav-link {\n        padding-top: $uds-size-spacing-2;\n      }\n    }\n\n    &:not(:last-child) {\n      border-bottom: 0;\n    }\n  }\n}\n",".bg-white,\n.bg-gray-1,\n.bg-gray-2 {\n  a {\n    color: $uds-color-base-maroon;\n  }\n  a:visited {\n    color: $uds-color-base-darkmaroon;\n  }\n}\n\n.bg-gray-7 {\n  a {\n    color: $uds-color-base-gold;\n  }\n  a:visited {\n    color: $uds-color-base-darkgold;\n  }\n}\n\nb,\nstrong {\n  font-weight: $uds-font-weight-bold;\n}\n","/*------------------------------------------------------------------\nFooter - Table of Contents\n\n1. Component Level Mixins\n2. Wrapper Base Colors\n3. Endorsed Footer (#endorsed-footer)\n4. Footer Columns (#footer-columns)\n5. Footer Innovation (#footer-innovation)\n6. Footer Colophon (#footer-colophon)\n-------------------------------------------------------------------*/\n\n/*------------------------------------------------------------------\n1. Component Level Mixins\n--------------------------------------------------------------------*/\n\n@mixin footer-links {\n  color: $uds-color-base-gray-2;\n  line-height: $uds-size-spacing-3;\n  text-decoration: none;\n\n  &:hover {\n    color: $uds-color-base-gold;\n    text-decoration: underline;\n  }\n}\n\n@mixin nav-to-grid {\n  .nav {\n    display: grid;\n    grid-template-rows: 1fr 1fr 1fr;\n    grid-auto-flow: column;\n    justify-items: start;\n    width: 100%;\n    padding: 0 2rem;\n  }\n\n  .nav-link {\n    margin-right: 0;\n    padding: 0.5rem 0;\n\n    &:nth-child(n + 4) {\n      justify-self: end;\n    }\n  }\n}\n\n/*------------------------------------------------------------------\n2. Wrapper Base Colors\n--------------------------------------------------------------------*/\n\n#wrapper-endorsed-footer,\n#wrapper-footer-columns {\n  background: $uds-color-divider-darker;\n\n  h5 {\n    color: $uds-color-base-white;\n  }\n}\n\n#wrapper-endorsed-footer {\n  a {\n    color: $uds-color-base-gray-2;\n  }\n}\n\n#wrapper-endorsed-footer + #wrapper-footer-columns {\n  border-top: 2px solid $uds-color-divider-lighter;\n}\n\n#wrapper-footer-innovation {\n  background-color: $uds-color-base-gold;\n  a {\n    margin-right: $uds-size-spacing-3;\n    text-decoration: none;\n    color: $uds-color-base-gray-7;\n  }\n}\n\n#wrapper-footer-colophon {\n  background-color: $uds-color-base-gray-2;\n  a {\n    margin-right: $uds-size-spacing-3;\n    text-decoration: none;\n    color: $uds-color-base-gray-7;\n  }\n}\n\n/*------------------------------------------------------------------\n3. Endorsed Footer (#endorsed-footer)\n--------------------------------------------------------------------*/\n\n// #endorsed-footer, mobile first design\n\n#endorsed-logo img {\n  width: 100%;\n  height: auto;\n  padding: $uds-size-spacing-3 0 $uds-size-spacing-2 0;\n}\n\n#social-media {\n  .nav {\n    padding-bottom: $uds-size-spacing-3;\n  }\n  .nav-link {\n    font-size: $uds-size-icon-base;\n    color: $uds-color-base-gray-4;\n    line-height: 1;\n    padding-top: 7px; // Magic number and a hack. Reducing the padding by 1px to make the height = 48px.\n  }\n}\n\n// #endorsed-footer, up to desktop\n\n@include media-breakpoint-up(md) {\n  #endorsed-logo img {\n    box-sizing: border-box;\n    padding: 0.5rem 0 0.5rem 0;\n    margin-left: -1.625rem; /* Magic number. Derived from internal padding of endorsed logo */\n    max-height: $uds-size-spacing-16;\n    width: auto;\n  }\n\n  #social-media .nav {\n    padding: $uds-size-spacing-5 0;\n    justify-content: flex-end;\n\n    .nav-item:last-child .nav-link {\n      padding-right: 0;\n    }\n  }\n}\n\n/*------------------------------------------------------------------\n4. Footer Columns (#footer-columns)\n--------------------------------------------------------------------*/\n\n// #footer-columns, mobile first design\n\n#footer-columns {\n  padding: $uds-size-spacing-3 $uds-size-spacing-4;\n\n  #info-column {\n    .contact-link {\n      margin-bottom: $uds-size-spacing-4;\n\n      a {\n        @include footer-links;\n        text-decoration: underline;\n      }\n    }\n\n    .contribute-button {\n      margin-bottom: $uds-size-spacing-4;\n    }\n  }\n\n  .flex-footer {\n    .card-foldable,\n    .card-header,\n    .card-body {\n      background: $uds-color-divider-darker;\n      color: #ffffff;\n      border: 0;\n    }\n\n    .card-header {\n      border-top: 1px solid $uds-color-divider-lighter;\n\n      a {\n        color: $uds-color-base-gray-2;\n        padding: $uds-size-spacing-3 0;\n        text-decoration: none;\n\n        &:hover {\n          background: $uds-color-divider-darker;\n        }\n      }\n    }\n\n    .card-body {\n      padding: 0 0 0 $uds-size-spacing-3;\n\n      .nav-link {\n        color: #ffffff;\n        padding: 0 0 $uds-size-spacing-2;\n        @include footer-links;\n      }\n    }\n  }\n}\n\n// #footer-columns, up to desktop\n\n@include media-breakpoint-up(xl) {\n  #footer-columns {\n    padding: $uds-size-spacing-6 0;\n\n    h5 {\n      margin: 0 0 $uds-size-spacing-3 0;\n    }\n\n    .flex-footer {\n      .card-header {\n        border-top: 0;\n        padding: 0;\n\n        a {\n          padding: 0;\n          cursor: default;\n        }\n\n        span {\n          display: none;\n        }\n      }\n\n      .card-body {\n        padding: 0;\n        transition-delay: 0;\n\n        &.collapse:not(.show) {\n          display: block;\n          min-height: auto;\n        }\n      }\n    }\n  }\n}\n\n/*------------------------------------------------------------------\n5. Footer Innovation (#footer-innovation)\n--------------------------------------------------------------------*/\n\n// #footer-innovtion, uses desktop first design for accessibility reasons.\n\n#footer-innovation {\n  .footer-innovation-links {\n    justify-content: space-between;\n    align-items: center;\n    font-weight: 700;\n    img {\n      height: 100px;\n      width: auto;\n      order: 2;\n    }\n\n    .nav-link {\n      padding: 0;\n    }\n  }\n}\n\n// #footer-innovation, Mobile\n@include media-breakpoint-down(lg) {\n  .footer-innovation-links {\n    padding-left: 15px;\n  }\n}\n@include media-breakpoint-down(md) {\n  #footer-innovation {\n    padding: 0;\n\n    .footer-innovation-links {\n      flex-direction: column;\n      padding-left: 0;\n      padding-bottom: $uds-size-spacing-3;\n\n      img {\n        width: 100%;\n        height: auto;\n        order: -1;\n      }\n\n      @include nav-to-grid;\n    }\n  }\n}\n\n/*------------------------------------------------------------------\n6. Footer Colophon (#footer-colophon)\n--------------------------------------------------------------------*/\n\n// #footer-colophon, uses desktop first design to mirror #footer-innovation\n\n#wrapper-footer-colophon .colophon {\n  margin: $uds-size-spacing-2 0;\n}\n\n#footer-colophon .nav-link {\n  padding: 0;\n}\n\n// #footer-colophon, Mobile\n\n@include media-breakpoint-down(md) {\n  #footer-colophon {\n    padding: 0;\n    @include nav-to-grid;\n  }\n}\n",'/*--------------------------------------------------------------\n# Blockquotes Alt\n\n1. Reset of various elements.\n2. New Blockquote, mobile\n3. New Blockquote, desktop\n--------------------------------------------------------------*/\n\n// Resets styles possibly applied by Bootstrap by default.\nblockquote {\n  border-left: none;\n  font-weight: inherit;\n  padding-left: 0;\n  max-width: none;\n}\n\n// In an older version of this element, the quote glyph was applied as a\n// CSS:before declaration. This prevents the accidental duplication of\n// quotes in the new format to follow.\n\nblockquote:before {\n  display: none;\n}\n\n/*------------------------------------------------------------------\n2. Blockquote, mobile\n------------------------------------------------------------------- */\n.uds-blockquote {\n\n  display: grid;\n  grid-template-columns: auto 1fr;\n  gap: $uds-size-spacing-3;\n\n  font-size: $uds-size-font-large;\n  font-weight: 700;\n\n  svg {\n    grid-column: 1;\n    fill: $uds-color-base-gray-7;\n    width: $uds-size-spacing-5;\n    height: auto;\n  }\n\n  blockquote {\n\n    grid-column: 2;\n    margin-top: 0;\n    margin-bottom: 0;\n\n    p:last-child {\n      margin-bottom: 0;\n    }\n\n    p:last-of-type:after {\n      content: "\\201D";\n    }\n  }\n\n  .citation {\n\n    cite {\n      display: block;\n      font-size: $uds-size-font-medium;\n      font-style: normal;\n\n      &.name {\n        font-weight: 700;\n      }\n\n      &.name:before {\n        padding-right: 0.5em;\n        content: "\\2014";\n      }\n\n      &.description {\n        font-weight: 400;\n        padding-left: 1.5rem;\n      }\n    }\n  }\n\n  &.with-image {\n\n    img {\n      max-width: 40px;\n      height: auto;\n      border-radius: 50%;\n    }\n\n    blockquote p:first-of-type:before {\n      content: "\\201C";\n    }\n\n  }\n\n  &.no-citation {\n    blockquote {\n\n      display: flex;\n      flex-direction: column;\n      justify-content: center;\n\n      p:first-of-type:before {\n        content: "\\201C";\n      }\n\n      h3 {\n        margin-bottom: 0;\n      }\n\n      h3+p {\n        margin-top: $uds-size-spacing-3;\n      }\n    }\n  }\n\n  &.accent-gold {\n    svg {\n      fill: $uds-color-base-gold;\n    }\n  }\n\n  &.accent-maroon {\n    svg {\n      fill: $uds-color-base-maroon;\n    }\n  }\n}\n\n/*------------------------------------------------------------------\n3. Blockquote, mobile only\n------------------------------------------------------------------- */\n\n@include media-breakpoint-down(sm) {\n  .uds-blockquote.no-cite.with-image {\n    display: flex;\n    flex-direction: column;\n    align-items: center;\n\n    blockquote,\n    h3 {\n      text-align: center;\n    }\n\n    img {\n      max-width: 180px;\n      height: auto;\n      border-radius: 50%;\n    }\n  }\n}\n\n/*------------------------------------------------------------------\n4. Blockquote, desktop\n------------------------------------------------------------------- */\n@include media-breakpoint-up(sm) {\n\n  .uds-blockquote {\n\n    &.no-cite {\n      align-items: center;\n    }\n\n    &.with-image {\n      gap: $uds-size-spacing-4;\n\n      img {\n        max-width: 180px;\n        height: auto;\n        border-radius: 50%;\n      }\n    }\n\n    &.with-image.reversed {\n\n      img {\n        grid-column: 2;\n      }\n\n      blockquote {\n        grid-column: 1;\n        grid-row: 1;\n      }\n    }\n  }\n\n}\n\n/*------------------------------------------------------------------\n5. Alt Citation.\n-  Produces a gold bar above the cite elements.\n------------------------------------------------------------------- */\n.alt-citation,\n.uds-testimonial {\n\n  .citation {\n\n    &:before {\n      content: \'\';\n      display: block;\n      background-color: $uds-color-base-gray-7;\n      height: $uds-size-spacing-half;\n      width: $uds-size-spacing-9;\n      margin: $uds-size-spacing-2 0;\n    }\n\n    cite.name:before {\n      content: none;\n    }\n\n    cite.description {\n      font-weight: 400;\n      padding-left: 0;\n    }\n  }\n\n  &.accent-gold .citation:before {\n    background-color: $uds-color-base-gold;\n  }\n\n  &.accent-maroon .citation:before {\n    background-color: $uds-color-base-maroon;\n  }\n}\n\n/*------------------------------------------------------------------\n5. Testimonial\n-  Vertically centered alignment of a standard blockquote.\n------------------------------------------------------------------- */\n.uds-blockquote.uds-testimonial {\n  display: flex;\n  flex-direction: column;\n  align-items: center;\n\n  blockquote {\n    text-align: center;\n\n    p:first-of-type:before {\n      content: "\\201C";\n    }\n\n    p:last-of-type:after {\n      content: "\\201D";\n    }\n\n    p:last-of-type {\n      margin-bottom: 0;\n    }\n  }\n\n  .citation:before {\n    display: inline-flex\n  }\n\n  &.with-image img {\n    max-width: 180px;\n  }\n}\n',"/*--------------------------------------------------------------\n# Global Header\n\n1. Wrapper Definitions, Global Mixins, Variables\n2. Top Menu\n3. Scrolled, Mobile\n4. Scrolled, Desktop\n5. Main Menu, Mobile\n6. Main Menu, Mobile Only\n7. Main Menu, Desktop\n8. Page Content\n--------------------------------------------------------------*/\n\n$fa-search: url($image-assets-path + '/font-awesome-svg/search.svg');\n\n@mixin transition {\n  transition: 0.5s cubic-bezier(0.19, 1, 0.19, 1);\n}\n\n@mixin gold-underline {\n  @include transition;\n  content: '';\n  display: block;\n  height: $uds-size-spacing-1;\n  /* Use linear gradient so we can offset and avoid little gold slivers */\n  background-image: linear-gradient(\n    to right,\n    transparent 0.5%,\n    $uds-color-base-gold 0.5%\n  );\n}\n\n@mixin gold-underline-mobile {\n  @include gold-underline;\n  position: absolute;\n  top: $uds-size-spacing-6;\n  bottom: inherit;\n  width: 0;\n  margin-left: $uds-size-spacing-4;\n}\n\n@mixin gold-underline-expand-mobile {\n  width: calc(100% - 4rem);\n  /* arbitrary number */\n  margin-left: $uds-size-spacing-4;\n}\n\n@mixin gold-underline-desktop {\n  @include gold-underline;\n  position: relative;\n  top: inherit;\n  bottom: 0;\n  width: 0;\n  margin-left: 0;\n}\n\n@mixin gold-underline-expand-desktop {\n  width: 100%;\n  margin-left: 0;\n}\n\n@mixin like-an-h5 {\n  font-size: 1rem;\n  font-weight: 700;\n  line-height: 1rem;\n  letter-spacing: -0.015em;\n}\n\n.dropdown-pinned {\n  overflow: hidden;\n  position: fixed;\n}\n\n/*--------------------------------------------------------------\n2. Top Menu\n--------------------------------------------------------------*/\n\n#wrapper-header-top {\n  background-color: $uds-color-base-gray-2;\n  height: 24px;\n  @include transition;\n\n  display: flex;\n  flex-direction: column;\n  justify-content: flex-start;\n  height: 24px;\n}\n\n#header-top {\n  background-color: $uds-color-base-gray-2;\n  height: 24px;\n  @include transition;\n\n  .nav {\n    justify-content: flex-end;\n    align-items: center;\n  }\